import React from "react";
import { Provider } from "react-redux";
import store from "./store";
import "./App.css";
import { BrowserRouter, Switch, Route } from "react-router-dom";

// components
import Indexgeuss from "./components/Geuss/indexgeuss";
import Login from "./components/login/loginclient";
import Indexclient from "./components/client/indexclient";
import Signupclient from "./components/signup/signupclient";
import Narbargeuss from "./components/Geuss/menu/menu";
import Signupprofesionnal from "./components/signup/signupprof";
import Navbargeuss from "./components/Geuss/menu/menu";
import Footer from "./components/footer/footer";
import Meetinglist from "./components/client/rendez-vous/meetingslist";
function App() {
  return (
    <Provider store={store}>
      <BrowserRouter>
        <Switch>
          <Route exact path="/">
            <Indexgeuss />
          </Route>
          <Route path="/login">
            <Navbargeuss />
            <Login />
            <Footer />
          </Route>
          <Route path="/signupclient">
            <Narbargeuss />
            <Signupclient />
            <Footer />
          </Route>
          <Route path="/signuppro">
            <Narbargeuss />
            <Signupprofesionnal />
          </Route>
          <Route path="/client">
            <Indexclient />
          </Route>
          <Route path="/pro">
            <Indexclient />
          </Route>
          <Route path="/admin">
            <Indexclient />
          </Route>
          <Route path="/client/profil">
            <Footer /> <Navbarclient />
          </Route>
        </Switch>
      </BrowserRouter>
    </Provider>
  );
}

export default App;
